import React from 'react'
import { NavLink } from 'react-router-dom'
import { items } from './MenuItems'

const Menu = ({isOpen}) => {
  return (
    <div className='Menu'>
      <span className='material-icons btn-close'>close</span>
      <div className="Menu-Items">
        {items.map((item,index)=> <NavLink to={item.itemLink} key={index}>
            {item.itemText}
        </NavLink>)}
      </div>
    </div>
  )
}

export default Menu
